ve=\"true\" scale=\"1.0\" src=\"ref://79e4f1cff1\"/\u003e\u003cText label=\"Analysis\"\u003e\u003c![CDATA[### This explains the Speed box plots  \nThe horizontal lines bottom and top are the min and max values  \nThe line across the waist of the box is the median value  \nThe bottom and top of the box are the 1st and 3rd quartile values  \nThe dots at the top are statistical outliers  \n\n  Hover on a box and it will show all the values  \n\n### Speed Analysis  \nparticuluarly in the Mens results you can see the height of the box has shrunk meaning the times of the majority and getting closer  \n2021 only had 2 events so doesn\u0027t have as much variation as normal years with more events.  \nThe times before 2012 were so slow you couldn\u0027t see the detail in the later years  \nThis is qualifying times only, the finals times are harder to collate as the format on the IFSC website has changed over the years  \n\n### Lead Analysis  \nThis show that generally there are more tops in female lead comps than there are in mens, this indicates the women are not being challenged as much as the men.  \nIn Finals in 12 of the last 16 years there have been more female tops, only 2 years where there were more tops, and 2 years where they were the same.]]\u003e\u003c/Text\u003e\u003c/Select\u003e\u003c/Group\u003e\u003c/Select\u003e\u003c/View\u003e", "assets": {"a937134f52": {"src": "data:application/vnd.datapane.table+html;base64,PHN0eWxlIHR5cGU9InRleHQvY3NzIj4KI1RfNTljY2FfICB7CiAgYm9yZGVyOiAycHggc29saWQgYmxhY2s7Cn0KI1RfNTljY2Ffcm93MF9jb2wxIHsKICB3aWR0aDogMTBlbTsKICBoZWlnaHQ6IDgwJTsKICBiYWNrZ3JvdW5kOiBsaW5lYXItZ3JhZGllbnQoOTBkZWcsbGlnaHRibHVlIDEwMC4wJSwgdHJhbnNwYXJlbnQgMTAwLjAlKTsKfQojVF81OWNjYV9yb3cxX2NvbDEgewogIHdpZHRoOiAxMGVtOwogIGhlaWdodDogODAlOwogIGJhY2tncm91bmQ6IGxpbmVhci1ncmFkaWVudCg5MGRlZyxsaWdodGJsdWUgODQuMiUsIHRyYW5zcGFyZW50IDg0LjIlKTsKfQojVF81OWNjYV9yb3cyX2NvbDEsICNUXzU5Y2NhX3JvdzNfY29sMSB7CiAgd2lkdGg6IDEwZW07CiAgaGVpZ2h0OiA4MCU7CiAgYmFja2dyb3VuZDogbGluZWFyLWdyYWRp
